          <div className='row top2 centre'>
              <h1>Estia</h1>
          </div>

          <div className='row top1'>
              <div className='col centre border'>Groceries</div>
              <div className='col border centre vertical-centre fas fa-bell'></div>              
          </div>


          <div className='row top1'>
              <div className='col centre border'>Cleaning products</div>
              <div className='col border centre vertical-centre fas fa-bell'></div>              
          </div>



          <div className='row top1'>
              <div className='col centre border fas fa-shopping-basket'>Cart</div>
              <div className='col border centre vertical-centre fas fa-bell'></div>              
          </div>






      </main>




    </div>
  );
}

export default Main;
